import { FaBeer } from 'react-icons/fa';
export const Navbar = () => {
  return (
    <div >
        <div></div>
        <div>
            <input type="search"></input>
            <p>Have a cold one <FaBeer /> </p>
           
        </div>
        <div></div>
    </div>
  )
}
